import React from "react";

function ItemList () {


   let items = [
      {
        title:"Grinder",
        imageSourcLink:"https://images-na.ssl-images-amazon.com/images/G/01/DiscoTec/2022/MothersDay/GW/QuadImageCard/Desktop/Mom_25_GW_QuadImageCard_Desktop_372x232._SY232_CB623622619_.jpg"
      },
      {
        title:"Jewerly",
        imageSourcLink:"https://images-na.ssl-images-amazon.com/images/G/01/AmazonServices/Site/US/Product/FBA/Outlet/Merchandising/Outlet_GW_J_186x116_Evergreen_Oct_2021._SY116_CB640520999_.jpg"

      },
  ]
   return (
   <React.Fragment>
   {items.map((item)=><Item imageSourcLink={item.imageSourcLink} title={item.title} />)}
   </React.Fragment>
   );

}

function Item (props) {
    return (
        <div className="container"> 
        <img src={props.imageSourcLink}/>
        <div className="item-name">{props.itemTitle}</div>
        </div>   
        )
}



export default ItemList;
